const e=[{id:"1663302496048",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"12月6日，赵耀教授主持的科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”项目2022项目进展总结会在线上召开。科技部高技术中心季与点、孟召宾项目主管，项目牵头单位北京交通大学科学技术研究院荆涛院长、牛利勇副院长，科技部项目专家组和顾问专家组的贺樑教授、吴飞教授、吴枫教授、王琦教授、张勇东教授、吕科教授、崔鹏副教授，项目负责人赵耀教授、课题负责人左旺孟教授、项目组骨干成员等26人参加了会议。      首先，北京交通大学科学研究院院长荆涛教授代表项目牵头单位对与会嘉宾致以诚挚欢迎，并表示将继续一如既往地全力支持项目研究工作，保障项目顺利实施并取得突出成果。随后，项目负责人北京交通大学赵耀教授、课题1负责人哈尔滨工业大学左旺孟教授、课题2研究骨干北京交通大学魏云超教授分别从项目和课题角度阐述了项目2022年实施过程中取得的阶段性成果。在专家质询与指导环节，与会各位专家都对项目实施一年以来取得的阶段性成果表示了肯定，并希望项目进一步凝练研究内容，紧扣连续学习研究主题，夯实理论研究基础，突出应用研究特色，力争取得更加丰硕的研究成果，推动我国在连续学习研究领域达到国际领先水平。最后，北京交通大学科学技术研究院牛利勇副院长对会议进行了总结，感谢各位专家百忙之中对项目的指导和建议，也对赵耀教授在项目的组织和实施过程中付出的努力表示感谢，并表达了对项目未来做出更多突出性成果的期望。至此， 2022年度项目总结会顺利结束，会后项目组成员召开了研讨会，进一步梳理了专家提出的问题，并规划了下一步研究重点和布局。"},{id:"1663302496102",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496129",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496134",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496156",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496157",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496182",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496200",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496209",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496235",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"},{id:"1663302496250",title:"科技创新2030—“新一代人工智能”重大项目“连续学习理论和方法”2022年度进展总结会成功召开",createTime:new Date,content:"这里是正文内容"}],t=e;export{t as d};
